import { PluginInitializerContext, CoreSetup, CoreStart, Plugin, Logger } from '@kbn/core/server';
import { i18n } from '@kbn/i18n';
import { License } from '@kbn/license-api-guard-plugin/server';
import { schema } from '@kbn/config-schema';
import { PLUGIN } from '../common/constants';
import { Dependencies } from './types';
import { registerRoutes } from './routes';
import type { CustomBrandingRequestHandlerContext } from './types';

const LOGO =
  'data:image/png;base64,';

export class CustomBrandingPlugin implements Plugin {
  private readonly license: License;
  private readonly logger: Logger;
  private readonly context: PluginInitializerContext;

  constructor(initializerContext: PluginInitializerContext) {
    this.logger = initializerContext.logger.get();
    this.license = new License();
    this.context = initializerContext;
  }

  public setup(core: CoreSetup) {
    this.logger.debug('customBranding: Setup');
    this.license.setup({
      pluginName: PLUGIN.getI18nName(i18n),
      logger: this.logger,
    });
    const router = core.http.createRouter<CustomBrandingRequestHandlerContext>();
    registerRoutes(router);
    core.uiSettings.registerGlobal({
      'customBranding:logo': {
        name: 'Custom Branding - Logo',
        value: LOGO,
        schema: schema.string(),
        description: 'add some awesomeness',
      },
      'customBranding:pageTitle': {
        name: 'Page Title',
        value: 'McDonalds',
        schema: schema.string(),
        description: 'add some awesomeness',
      },
      'customBranding:faviconPNG': {
        name: 'PNG',
        value: 'https://cdn-icons-png.flaticon.com/512/732/732060.png',
        schema: schema.string(),
        description: 'add some awesomeness',
      },
    });
    core.customBranding.register();
    return {};
  }

  public start(core: CoreStart, { licensing }: Dependencies) {
    this.logger.debug('customBranding: Started');
    this.license.start({
      pluginId: PLUGIN.ID,
      minimumLicenseType: PLUGIN.MINIMUM_LICENSE_REQUIRED,
      licensing,
    });
    return {};
  }

  public stop() {}
}
